import React from 'react';
import TestState from './allTodos/testState';
import Todos from './todos/todos';
import Header from './Header/header';

const Main = () => {
    return (
        <div>
            <Header/>
            <TestState/>
            <Todos/>
        </div>
    );
}

export default Main;
